  \"2016-07-27T22:19:28.794075\",\n\t\"name\": \"feasibility-of-reintroduction-of-the-greater-prairie-chicken-to-neal-smith-national-wildli\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The objective of this document is to investigate
  feasibility of introduction of prairie-chickens to Neal Smith National Wildlife
  Refuge at this time. This includes developing an understanding of the habitat, refuge
  management, refuge resource, and partnership needs to accomplish the task. Also
  critical, is developing an understanding of timing for prairie-chicken introduction
  within the context of ecological restoration.  The results of the study are that
  the Refuge is not currently appropriate for Greater Prairie-chicken introduction
  due to landscape features that relate negatively to prairie-chicken habitat (abundance
  of trees, proximity to roads and structures).\",\n\t\"license_title\": \"License
